import React from "react";
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  const handleNavigateToUsers = () => {
    navigate('/users'); // Replace with your user list route
  };

  return (
    <div className="container mx-auto mt-8 p-4 bg-black">
      <h1 className="text-3xl font-bold mb-4">Welcome to Your App</h1>

      <section className="mb-8">
        {/* Introduction/Headline */}
        <p className="text-lg">
          This is the home page of your awesome React application. You can customize this content to provide an overview of what your app does.
        </p>
      </section>

      <section className="mb-8">
        {/* Call-to-Action (e.g., View Users) */}
        <button
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
          onClick={handleNavigateToUsers}
        >
          View Users
        </button>
      </section>

      <section>
        {/* Other Content (e.g., Features, Testimonials) */}
        {/* ... add more sections as needed */}
      </section>
    </div>
  );
};

export default Home;
